import React from 'react';

const OrangeButton = () => {
  return (
    <button
      style={{
        border: '1px solid orange',
        borderRadius: '4px',
        padding: '8px 16px',
        backgroundColor: 'white',
        color: 'orange',
        fontWeight: 'bold',
        marginLeft:100
      }}
    >
      Orange Button
    </button>
  );
};

export default OrangeButton;
